import React from 'react';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';

import Rating from '@mui/material/Rating';
import IconButton from '@mui/material/IconButton';
import { GoogleIcon } from './icons/googleicon';
import { HotPepperIcon } from './icons/hotpeppericon';
import { margin, maxWidth } from '@mui/system';

export default function ResultCard(props) {
    let mode = props.mode;
    return (
        <Card sx={{ 
                    height : mode == 'noresults' ? 200 : 150}}>
            {props.mode != 'noresults' && <CardMedia
                component="img"
                height="140"
                image={props.photo}
                alt="green iguana"
            />}
            <CardContent>
                <Typography gutterBottom variant="h5" component="div"
                sx={{ textAlign : 'center'}}>
                    {props.name}
                </Typography>
                <Typography variant="body2"ã€€
                    sx={{ 
                        fontSize : mode == 'noresults' ? '5rem' : '2rem',
                        textAlign : 'center'
                    }}
                    color="text.secondary">
                    {props.vicinity}
                </Typography>
                {props.mode != 'noresults' && <Rating name="read-only" value={props.rating} precision={0.5} />}
            </CardContent>
            {props.mode != 'noresults' && <CardActions>
                <Button size="small">Share</Button>
                <Button size="small">Learn More</Button>
                <IconButton aria-label="delete">
                    <GoogleIcon />
                </IconButton>
                <IconButton aria-label="delete">
                    <HotPepperIcon />
                </IconButton>
            </CardActions>}
        </Card>
    );
}
